    function safeTransfer(
        CallData memory _cd,
        address _from,
        address _to,
        uint256 _tokenId,
        uint256 _lentAmount
    ) private {
        if (is721(_cd.nft)) {
            IERC721(_cd.nft).transferFrom(_from, _to, _cd.tokenId);
        } else if (is1155(_cd.nft)) {
            IERC1155(_cd.nft).safeTransferFrom(
                _from,
                _to,
                _tokenId,
                _lentAmount,
                ""
            );
        } else {
            revert("ReNFT::unsupported token type");
        }
    }

